import React from 'react';
import { Navbar, Container, Nav, NavDropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom

const AppNavbar = () => {
  return (
    <Navbar expand="lg" style={{ backgroundColor: "gray" }}>
      <Container>
        <Link to="/home" style={{ fontSize: "200%", color: "orange", fontStyle: "italic", textDecoration: 'none' }}>
          ðŸŽ¬  MOVIES
        </Link>
        <Navbar.Toggle aria-controls="navbarNavDropdown" />
        <Navbar.Collapse id="navbarNavDropdown">
          <Nav className="mr-auto">
            <Link to="/home" className="nav-link" style={{ paddingLeft: "280%" }}>
              Home
            </Link>
            <Link to="#" className="nav-link">
              Favourites
            </Link>

            <NavDropdown title="Dropdown link" id="navbarDropdownMenuLink">
              <Link to="#" className="dropdown-item">Login</Link>
              <Link to="#" className="dropdown-item">Register</Link>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default AppNavbar;
